void array_remove_dups_original(int *data, int *len) {
    for (int i = 0; i < *len - 1; ++i) {
        for (int j = i + 1; j < *len; ++j) {
            if (data[i] == data[j]) {
                for (int k = j; k < *len - 1; ++k) {
                    data[k] = data[k+1];
                }
                --(*len), --j;
            }
        }
    }
}

int *array_input_original(int *len) {
    printf("Number of elements: ");
    scanf("%d", len);
    int *data = malloc(*len * sizeof(int));
    if (!data) {
        printf("Failed to allocate memory\n");
        return NULL;
    }
    for (int i = 0; i < *len; ++i) {
        printf("Element at index %d: ", i);
        scanf("%d", &data[i]);
    }
    return data;
}

